import React from "react";
import PopupWithForm from "./PopupWithForm";

function AddPlacePopup({ onClose, isOpen }) {
  return (
    <PopupWithForm
      isOpen={isOpen}
      onClose={onClose}
      name="popup_new-place"
      title="Новое место"
      textButton="Создать"
      children={[
        <label class="popup__field">
          <input
            type="text"
            class="popup__input popup__input_type_place"
            placeholder="Название"
            required
            minlength="2"
            maxlength="30"
            name="place"
          />
          <span class="popup__error" id="place-error"></span>
        </label>,
        <label class="popup__field">
          <input
            class="popup__input popup__input_type_link"
            placeholder="Ссылка на картинку"
            required
            type="url"
            name="link"
          />
          <span class="popup__error" id="link-error"></span>
        </label>,
      ]}
    />
  );
}

export default AddPlacePopup;
